#[cfg(test)]
#[test]
fn test_allowed_in_words_casing_closure() {
    for c in '\0'..=char::MAX {
        if allowed_in_word(c) {
            assert!(c.to_uppercase().all(allowed_in_word));
            assert!(c.to_lowercase().all(allowed_in_word));
        }
    }
}
